do_uudecode() {
	# Don't put a '}' with no whitespace on a line by itself in this
	# function, this breaks stripping, use ' }' instead.
	if command -v uudecode >/dev/null; then
		_uudecode=uudecode
	elif command -v guudecode >/dev/null; then
		_uudecode=guudecode
	else
		_uudecode=""
	fi

	# first see if uudecode is available
	if [ -n "$_uudecode" ]; then
		"$_uudecode" -o /dev/stdout
		return $?
	fi

	# try perl, python, ruby then awk, see prototypes dir
	if command -v perl >/dev/null; then
		perl -e '
binmode STDOUT; # for win32 perls
<>;

while (<>) {
	last if /^end$/;

	print unpack("u", $_);
 }
'
		return $?
	fi

	# see if python is available
	if command -v python2 >/dev/null; then
		_python=python2
	elif command -v python >/dev/null; then
		_python=python
	elif command -v python3 >/dev/null; then
		_python=python3
	fi

	if [ -n "$_python" ]; then
		"$_python" -c 'import uu; from sys import stdin, stdout; uu.decode(stdin, stdout)'
		return $?
	fi

	# try ruby as well!
	if command -v ruby >/dev/null; then
		ruby -e '
gets

while line = gets
    break if line =~ /^end$/

    print line.unpack("u").join("")
end
